import React from 'react'
import './App.css'
import {Card} from "./components/card/Card";
import {Table} from "./components/table/Table";

let num = 16;
let status = 'open';
class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            pictures: ['../public.1.jpg', '../public.2.jpg', '../public.3.jpg', '../public.4.jpg', '../public.5.jpg', '../public.6.jpg', '../public.7.jpg', '../public.8.jpg', '../public.9.jpg', '../public.10.jpg', '../public.1.jpg', '../public.2.jpg', '../public.3.jpg', '../public.4.jpg', '../public.5.jpg', '../public.6.jpg']
        }
    }
    render() {
        return <Table>
            {this.state.pictures.map(function(item, index) {
                return <img src={item} alt=""/>
            })}
        </Table>
    }
}

export default App
